import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';

@Component({
  selector: 'app-nav-menu',
  templateUrl: './nav-menu.component.html',
  styleUrls: ['./nav-menu.component.css']
})
export class NavMenuComponent {
  public themes = [];

  isExpanded = false;

  collapse() {
    this.isExpanded = false;
  }

  toggle() {
    this.isExpanded = !this.isExpanded;
  }

  constructor(private http: HttpClient) { }

  ngOnInit() {

    this.http.get(`https://bootswatch.com/api/5.json`).subscribe(result => {
      this.themes = result.themes;
    }, error => {
      console.error(error);
    });

  }

}
<header>
  <nav
    class="navbar navbar-expand navbar-toggleable-sm bg-primary box-shadow" data-bs-theme="dark">
    <div class="container">
      <a class="navbar-brand" [routerLink]="['/']">TestGorilla-Arcadian</a>
      <button
        class="navbar-toggler"
        type="button"
        data-toggle="collapse"
        data-target=".navbar-collapse"
        aria-label="Toggle navigation"
        [attr.aria-expanded]="isExpanded"
        (click)="toggle()"
      >
        <span class="navbar-toggler-icon"></span>
      </button>
      <div
        class="navbar-collapse collapse d-sm-inline-flex justify-content-end"
        [ngClass]="{ show: isExpanded }"
